//generate icon
const iconGenerator = (para, Parachoice) => {
    if (Parachoice === 'Temp') {
        if (para < -5) {
            return Tam50
        } else if (para > -1 && para < 5) {
            return Ta05
        } else if (para > 5 && para < 10) {
            return Ta510
        } else if (para > 9 && para < 15) {
            return Ta1015
        } else if (para > 14 && para < 20) {
            return Ta1520
        } else if (para > 19 && para < 25) {
            return Ta2025
        } else if (para > 24 && para < 30) {
            return Ta2530
        } else if (para > 29 && para < 35) {
            return Ta3035
        } else if (para > 34 && para < 40) {
            return Ta3540
        } else if (para > 39 && para < 45) {
            return Ta4045
        } else if (para > 44 && para < 50) {
            return Ta4550
        } else if (!para) {
            return TaNo
        }
    } else if (Parachoice === 'Humidity') {
        if (!para) {
            return RHNo
        } else if (para > -1 && para < 20) {
            return RH020
        } else if (para > 19 && para < 40) {
            return RH2040
        } else if (para > 39 && para < 60) {
            return RH4060
        } else if (para > 59 && para < 80) {
            return RH6080
        } else if (para > 79 && para < 101) {
            return RH80100
        }
    } else if (Parachoice === 'Rain') {
        if (!para) {
            return PercipNo
        } else if (para > -1 && para < 8) {
            return Percip010
        } else if (para > 7 && para < 16) {
            return Percip1020
        } else if (para > 15 && para < 24) {
            return Percip2030
        } else if (para > 23 && para < 32) {
            return Percip3040
        } else if (para > 31) {
            return Percip4050
        }

    } else if (Parachoice === 'Solar') {
        if (!para) {
            return SunNo
        } else if (para > -1 && para < 201) {
            return Sun02
        } else if (para > 200 && para < 401) {
            return Sun35
        } else if (para > 400 && para < 601) {
            return Sun68
        } else if (para > 600 && para < 801) {
            return Sun910
        } else if (para > 800) {
            return Sun11
        }
    }
}

const windIconGenerator = (speed, deg) => {
    if (speed < 0 || !speed) {
        return AirNo
    } else if (speed > 0 && speed < 2) {
        if (deg < 20 || deg > 339) {
            return Air02U
        } else if (deg > 19 && deg < 70) {
            return Air02RU
        } else if (deg > 69 && deg < 110) {
            return Air02R
        } else if (deg > 109 && deg < 160) {
            return Air02RD
        } else if (deg > 159 && deg < 200) {
            return Air02D
        } else if (deg > 199 && deg < 250) {
            return Air02LD
        } else if (deg > 249 && deg < 290) {
            return Air02L
        } else if (deg > 289 && deg < 340) {
            return Air02LU
        }
    } else if (speed > 1.9 && speed < 12) {
        if (deg < 20 || deg > 339) {
            return Air212U
        } else if (deg > 19 && deg < 70) {
            return Air212RU
        } else if (deg > 69 && deg < 110) {
            return Air212R
        } else if (deg > 109 && deg < 160) {
            return Air212RD
        } else if (deg > 159 && deg < 200) {
            return Air212D
        } else if (deg > 199 && deg < 250) {
            return Air212LD
        } else if (deg > 249 && deg < 290) {
            return Air212L
        } else if (deg > 289 && deg < 340) {
            return Air212LU
        }
    } else if (speed > 11.9 && speed < 22) {
        if (deg < 20 || deg > 339) {
            return Air1222U
        } else if (deg > 19 && deg < 70) {
            return Air1222RU
        } else if (deg > 69 && deg < 110) {
            return Air1222R
        } else if (deg > 109 && deg < 160) {
            return Air1222RD
        } else if (deg > 159 && deg < 200) {
            return Air1222D
        } else if (deg > 199 && deg < 250) {
            return Air1222LD
        } else if (deg > 249 && deg < 290) {
            return Air1222L
        } else if (deg > 289 && deg < 340) {
            return Air1222LU
        }

    }else if (speed > 21.9 && speed < 32) {
        if (deg < 20 || deg > 339 ) {
            return Air2232U
        } else if (deg > 19 && deg < 70) {
            return Air2232RU
        } else if (deg > 69 && deg < 110) {
            return Air2232R
        } else if (deg > 109 && deg < 160) {
            return Air2232RD
        } else if (deg > 159 && deg < 200) {
            return Air2232D
        } else if (deg > 199 && deg < 250) {
            return Air2232LD
        } else if (deg > 249 && deg < 290) {
            return Air2232L
        } else if (deg > 289 && deg < 340) {
            return Air2232LU
        }
    }else if (speed > 31.9 ) {
        if (deg < 20 || deg > 339 ) {
            return Air3240U
        } else if (deg > 19 && deg < 70) {
            return Air3240RU
        } else if (deg > 69 && deg < 110) {
            return Air3240R
        } else if (deg > 109 && deg < 160) {
            return Air3240RD
        } else if (deg > 159 && deg < 200) {
            return Air3240D
        } else if (deg > 199 && deg < 250) {
            return Air3240LD
        } else if (deg > 249 && deg < 290) {
            return Air3240L
        } else if (deg > 289 && deg < 340) {
            return Air3240LU
        }
    }
}
